<head>
	<title>Pages</title>
	<meta name="viewport" content="width=device-width, initial-scale=1">
	<meta name="keywords" content="erath, storage-less web page hosting, internet freedom, online privacy, anonymous internet">
	<meta name="description" content="Discover the aim and mission of storage-less web page hosting, a pioneering platform that empowers individuals and communities with a fully decentralized approach to website building, management, and hosting. Learn about our commitment to a more transparent, and free internet, and how we're working to make this aim a reality. Join us in our mission to create a safer and more private online world for all.">
	<link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/4.7.0/css/font-awesome.min.css">
	<style>
		body {
			font-family: Arial, sans-serif;
			background-color: #f4f4f4;
			margin: 0;
			padding: 0;
		}

		.header {
			background-color: #444;
			color: #fff;
			padding: 10px;
			text-align: center;
		}

		h1 {
			text-align: center;
			margin-top: 50px;
			color: #999;
			font-size: 2.5rem;
			letter-spacing: 1px;
		}

		.container {
			display: flex;
			flex-direction: row;
			align-items: flex-start;
			justify-content: center;
			flex-wrap: wrap;
			margin: 50px auto;
			max-width: 1200px;
		}

		.box {
			background-color: #fff;
			border-radius: 10px;
			box-shadow: 0px 0px 10px 0px rgba(0,0,0,0.2);
			padding: 30px;
			width: 300px;
			margin: 20px;
			text-align: center;
			transition: all 0.3s ease;
		}

		.box:hover {
			transform: scale(1.05);
			box-shadow: 0px 0px 20px 0px rgba(0,0,0,0.4);
		}

		.icon {
			font-size: 50px;
			margin-bottom: 20px;
			color: #0077b6;
		}

		.title {
			font-size: 28px;
			font-weight: 700;
			margin-bottom: 20px;
			color: #333;
		}

		p {
			margin-bottom: 20px;
			color: #999;
			line-height: 1.5;
			font-size: 16px;
			font-weight: 500;
			text-align: justify;
			padding: 0 20px;
		}

		.button {
			background-color: #999;
			border: none;
			color: #fff;
			padding: 10px 20px;
			border-radius: 5px;
			text-transform: uppercase;
			font-weight: bold;
			cursor: pointer;
			transition: all 0.3s ease;
			margin-top: 10px;
			display: inline-block;
		}

		.button:hover {
			background-color: #999;
		}

		@media (max-width: 768px) {
			.box {
				margin: 20px auto;
			}
		}

		@media (max-width: 560px) {
			h1 {
				font-size: 2rem;
			}

			p {
				font-size: 14px;
			}

			.box {
				width: 70%;
			}
		}
	</style>
</head>
